import React from 'react';
import { useHistory } from 'react-router-dom';
import './Admin.css';

const Admin = () => {
  const history = useHistory();

  const addSkill = () => {
    history.push('/admin/skills/add');
  };

  const logOut = () => {
    localStorage.clear();
    window.location.reload();
  };

  return (
    <div className="container-fluid">
      <div className="row g-3 mt-3 text-center">
        <div className="col-4">
          <div className="card border-5 shadow bg-gradient bg-light">
            <h5 className="card-title">Manage Freelancers</h5>
            <div className="card-body">
              <button className="btn btn-outline-success" onClick={() => history.push('/admin/freelancers')}>
                List all Freelancers
              </button>
            </div>
          </div>
        </div>
        <div className="col-4">
          <div className="card border-5 shadow bg-gradient bg-light">
            <h5 className="card-title">Manage Recruiters</h5>
            <div className="card-body">
              <button className="btn btn-outline-warning" onClick={() => history.push('/admin/recruiters')}>
                List all Recruiters
              </button>
            </div>
          </div>
        </div>
        <div className="col-4">
          <div className="card border-5 shadow bg-gradient bg-light">
            <h5 className="card-title">Manage Skills</h5>
            <div className="card-body">
              <div className="mb-1">
                <button className="btn btn-outline-success" onClick={addSkill}>
                  Add new Skill
                </button>
              </div>
              <div className="mb-1">
                <button className="btn btn-outline-dark" onClick={() => history.push('/admin/skills')}>
                  List all Skills
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
      <div className="row">
        <div className="col-4"></div>
        <div className="col-4">
          <button className="btn btn-danger" onClick={logOut}>
            Log Out
          </button>
        </div>
        <div className="col-4"></div>
      </div>
    </div>
  );
};

export default Admin;
